import Product from "./Product";

const Container = styled.div`
  width: 95%;
  height: 500px;
  max-width: 1200px;
  margin: 0 auto;
  margin-top: 70px;
  padding: 50px 20px;
`;

const Title = styled.div`
  width: 100%;
  font-size: 2rem;
  line-height: 2rem;
  font-weight: 800;
  text-align: left;
`;

const Subtitle = styled.div`
  width: 100%;
  font-size: 1.2rem;
  line-height: 1.2rem;
  text-align: left;
  margin-top: 40px;
`;

const ProductsContainer = styled.div`
  width: 100%;
  padding: 20px 0;
`;

const ProductsHeader = styled.div`
  width: 100%;
`;

const ProductsPage = () => {
  return (
    <Container>
      <Title>Coinomo Yield Products</Title>
      <Subtitle>
        Lorem ipsum dolor sit amet, consectetur adipiscing elit, sed do eiusmod
        tempor incididunt ut labore et dolore magna aliqua
      </Subtitle>
      <ProductsContainer>
        <Product />
      </ProductsContainer>
    </Container>
  );
};

export default ProductsPage;
